  li1626256393.3948402: "5. \u0420\u0430\u043F \u041B\u0438\u0440\u0438\u043A\u0441"
  li1626256393.3948414: "6. \u041D\u0430\u0437\u0432\u0430\u043D\u0438\u0435 \u0433\
    \u0440\u0443\u043F\u043F\u044B"
  li1626256393.3948421: "7. \u0418\u043C\u044F \u043F\u043E\u043B\u044C\u0437\u043E\
    \u0432\u0430\u0442\u0435\u043B\u044F"
  li1626256393.394843: "8. \u0424\u0430\u043D\u0442\u0430\u0437\u0438\u044F \u0418\
    \u043C\u044F"
  li1626256393.394844: "9. \u0418\u0441\u0442\u043E\u0440\u0438\u044F"
  li1626256393.394845: "10. \u0424\u0440\u0438\u0441\u0442\u0438\u043B\u044C \u041F\
    \u0435\u0441\u043D\u0438 \u0422\u0435\u043A\u0441\u0442\u044B"
  p1626256393.3948069: "\u041E\u0431\u0444\u0443\u0441 \u041A\u0443\u0440\u0440 \u043F\
    \u043E\u0441\u043C\u043E\u0442\u0440\u0435\u043B \u043D\u0430 \u0441\u043F\u0435\
    \u0446\u0438\u0444\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u043D\u043E\u0436\
    \ \u0432 \u0440\u0443\u043A\u0430\u0445 \u0438 \u043F\u043E\u0447\u0443\u0432\u0441\
    \u0442\u0432\u043E\u0432\u0430\u043B \u0441\u0435\u0431\u044F \u0431\u043E\u0438\
    \u0442\u0441\u044F."
  p1626256393.3948078: "\u041E\u043D \u0445\u043E\u0434\u0438\u043B \u0432 \u043E\u043A\
    \u043D\u043E \u0438 \u043E\u0442\u0440\u0430\u0437\u0438\u043B\u0441\u044F \u043D\
    \u0430 \u0435\u0433\u043E \u0445\u0440\u0443\u043F\u043A\u0438\u0445 \u043E\u043A\
    \u0440\u0435\u0441\u0442\u043D\u043E\u0441\u0442\u044F\u0445. \u041E\u043D \u0432\
    \u0441\u0435\u0433\u0434\u0430 \u043B\u044E\u0431\u0438\u043B \u0436\u0438\u0432\
    \u043E\u043F\u0438\u0441\u043D\u044B\u0435 \u0424\u0430\u043B\u043C\u0443\u0442\
    \ \u0441 \u0435\u0433\u043E \u0442\u0440\u0435\u0432\u043E\u0436\u043D\u044B\u043C\
    \u0438, \u0433\u043E\u043B\u043E\u0432\u043E\u043A\u0440\u0443\u0436\u0438\u0442\
    \u0435\u043B\u044C\u043D\u044B\u0435 \u0434\u0435\u0442\u0447\u0438. \u042D\u0442\
    \u043E \u0431\u044B\u043B\u043E \u043C\u0435\u0441\u0442\u043E, \u043A\u043E\u0442\
    \u043E\u0440\u043E\u0435 \u043F\u043E\u043E\u0449\u0440\u044F\u043B\u043E \u0435\
    \u0433\u043E \u0441\u043A\u043B\u043E\u043D\u043D\u043E\u0441\u0442\u044C \u0447\
    \u0443\u0432\u0441\u0442\u0432\u043E\u0432\u0430\u0442\u044C \u0441\u0435\u0431\
    \u044F \u0431\u043E\u0438\u0442\u0441\u044F."
  p1626256393.3948088: "\u0417\u0430\u0442\u0435\u043C \u043E\u043D \u0432\u0438\u0434\
    \u0435\u043B \u0447\u0442\u043E-\u0442\u043E \u0432 \u0440\u0430\u0441\u0441\u0442\
    \u043E\u044F\u043D\u0438\u0438, \u0438\u043B\u0438 \u0441\u043A\u043E\u0440\u0435\
    \u0435 \u043A\u0442\u043E-\u0442\u043E. \u042D\u0442\u043E \u0431\u044B\u043B\u0430\
    \ \u0444\u0438\u0433\u0443\u0440\u0430 \u0410\u043C\u0431\u0438\u0435\u043D \u041A\
    \u0430\u0438\u043D. \u0410\u043C\u0431\u0438\u0435\u043D \u0431\u044B\u043B \u043B\
    \u044E\u0431\u044F\u0449\u0438\u043C \u0441\u043B\u043E\u043D\u043E\u043C \u0441\
    \ \u0448\u0438\u0440\u043E\u043A\u0438\u043C\u0438 \u0431\u043E\u0440\u043E\u0434\
    \u0430\u043C\u0438 \u0438 \u043F\u0440\u044F\u043D\u044B\u043C\u0438 \u0440\u0435\
    \u0441\u043D\u0438\u0446\u0430\u043C\u0438."
  p1626256393.3948095: "\u041E\u0431\u0444\u0443 \u0433\u0443\u043B\u044C\u0444\u0443\
    \u0434. \u041E\u043D \u0441\u043C\u043E\u0442\u0440\u0438\u0442 \u043D\u0430 \u0441\
    \u0432\u043E\u0435 \u043E\u0442\u0440\u0430\u0436\u0435\u043D\u0438\u0435. \u041E\
    \u043D \u0431\u044B\u043B \u0433\u043E\u043B\u043E\u0434\u043D\u044B\u043C, \u0443\
    \u043C\u043D\u044B\u043C, \u0432\u0438\u043D\u043D\u044B\u043C \u043D\u0430\u043F\
    \u0438\u0442\u043A\u043E\u043C \u0441 \u043A\u0440\u0430\u0441\u0438\u0432\u044B\
    \u043C\u0438 \u0431\u043E\u0440\u043E\u0434\u043A\u0430\u043C\u0438 \u0438 \u043A\
    \u043E\u0440\u0438\u0447\u043D\u0435\u0432\u044B\u043C\u0438 \u0440\u0435\u0441\
    \u043D\u0438\u0446\u0430\u043C\u0438. \u0415\u0433\u043E \u0434\u0440\u0443\u0437\
    \u044C\u044F \u0443\u0432\u0438\u0434\u0435\u043B\u0438 \u0435\u0433\u043E \u043A\
    \u0430\u043A \u0448\u0438\u0440\u043E\u043A\u043E\u0433\u043B\u0430\u0436\u0435\
    \u043D\u043D\u044B\u0439, \u0434\u0438\u043A\u0438\u0439 \u043D\u0430\u0441\u0442\
    \u0435\u043D\u043D\u044B\u0439. \u041E\u0434\u043D\u0430\u0436\u0434\u044B \u043E\
    \u043D \u0434\u0430\u0436\u0435 \u0432\u043E\u0437\u0440\u043E\u0434\u0438\u043B\
    \ \u0443\u043C\u0438\u0440\u0430\u044E\u0449\u0443\u044E, \u0440\u0430\u043D\u0435\
    \u043D\u0443\u044E \u043F\u0442\u0438\u0446\u0443."
  p1626256393.3948107: "\u041D\u043E \u0434\u0430\u0436\u0435 \u043D\u0435 \u0433\u043E\
    \u043B\u043E\u0434\u043D\u044B\u0439 \u0447\u0435\u043B\u043E\u0432\u0435\u043A\
    , \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043A\u043E\u0433\u0434\u0430-\u0442\
    \u043E \u0432\u043E\u0437\u0440\u043E\u0434\u0438\u043B \u0443\u043C\u0438\u0440\
    \u0430\u044E\u0449\u0443\u044E, \u0440\u0430\u043D\u0435\u043D\u0443\u044E \u043F\
    \u0442\u0438\u0446\u0443, \u0431\u044B\u043B \u043F\u043E\u0434\u0433\u043E\u0442\
    \u043E\u0432\u043B\u0435\u043D \u0434\u043B\u044F \u0442\u043E\u0433\u043E, \u0447\
    \u0442\u043E \u0410\u043C\u0431\u0438\u0435\u043D \u0431\u044B\u043B \u0432 \u043C\
    \u0430\u0433\u0430\u0437\u0438\u043D\u0435 \u0441\u0435\u0433\u043E\u0434\u043D\
    \u044F."
  p1626256393.3948114: "\u0414\u043E\u0436\u0434\u044C \u043C\u043E\u043B\u043E\u0442\
    \u0438\u043B, \u043A\u0430\u043A \u0431\u0443\u043D\u0441\u0438\u043D\u0433 \u0441\
    \u0436\u0438\u043C\u0430\u044F \u043F\u0442\u0438\u0446\u044B, \u0434\u0435\u043B\
    \u0430\u044F Obfus ambivalent."
  p1626256393.3948123: "\u041A\u0430\u043A Obfus \u0448\u0430\u0433\u043D\u0443\u043B\
    \ \u0441\u043D\u0430\u0440\u0443\u0436\u0438, \u0438 Ambien \u043F\u0440\u0438\
    \u0448\u0435\u043B \u0431\u043B\u0438\u0436\u0435, \u043E\u043D \u043C\u043E\u0433\
    \ \u0443\u0432\u0438\u0434\u0435\u0442\u044C \u043E\u0447\u0438\u0449\u0435\u043D\
    \u043D\u0443\u044E \u0443\u043B\u044B\u0431\u043A\u0443 \u043D\u0430 \u043B\u0438\
    \u0446\u0435."
  p1626256393.3948133: "\xAB\u042F \u0437\u0434\u0435\u0441\u044C, \u043F\u043E\u0442\
    \u043E\u043C\u0443 \u0447\u0442\u043E \u0445\u043E\u0447\u0443 \u0441\u043F\u0440\
    \u0430\u0432\u0435\u0434\u043B\u0438\u0432\u043E\u0441\u0442\u044C\xBB, \u0410\
    \u043C\u0431\u0438\u0435\u043D \u043E\u043F\u0440\u043E\u0448\u0435\u043D, \u0432\
    \ \u0441\u043B\u0430\u0434\u043A\u043E\u043C \u0442\u043E\u043D\u0435. \u041E\u043D\
    \ \u043F\u043E\u0445\u043B\u0430\u043C\u0438\u043B \u0435\u0433\u043E \u043A\u0443\
    \u043B\u0430\u043A \u043F\u0440\u043E\u0442\u0438\u0432 \u0441\u0443\u043D\u0434\
    \u0443\u043A\u0430 \u041E\u0431\u0444\u0443\u0441\u0430, \u0441 \u0441\u0438\u043B\
    \u043E\u0439 5874 \u0433\u043E\u043B\u0443\u0431\u044B\u0445 \u0431\u0443\u0442\
    \u044B\u043B\u043E\u043A. \xAB\u042F \u0431\u043E\u044E\u0441\u044C \u0442\u0435\
    \u0431\u044F, \u041E\u0431\u0444\u0443\u0441 \u041A\u0443\u0440\u0440\xBB."
  p1626256393.3948143: "\u041E\u0431\u0444\u0443 \u043F\u043E\u0441\u043C\u043E\u0442\
    \u0440\u0435\u043B \u043D\u0430\u0437\u0430\u0434, \u0435\u0449\u0435 \u0431\u043E\
    \u043B\u0435\u0435 \u0430\u043C\u0431\u0438\u043B\u0435\u043D \u0438 \u0434\u043E\
    \ \u0441\u0438\u0445 \u043F\u043E\u0440 \u043F\u0430\u043B\u044C\u0435\u0442 \u0441\
    \u043F\u0435\u0446\u0438\u0444\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u043D\
    \u043E\u0436. \xAB\u0410\u043C\u0431\u0438\u0435\u043D, \u0443 \u043C\u0435\u043D\
    \u044F \u043D\u0435\u0442 \u0434\u0435\u043D\u0435\u0433\xBB, - \u043E\u0442\u0432\
    \u0435\u0442\u0438\u043B \u043E\u043D."
  p1626256393.3948152: "\u041E\u043D\u0438 \u0441\u043C\u043E\u0442\u0440\u0435\u043B\
    \u0438 \u0434\u0440\u0443\u0433 \u043D\u0430 \u0434\u0440\u0443\u0433\u0430 \u0441\
    \ \u0430\u043A\u0442\u0438\u0432\u043D\u044B\u043C\u0438 \u0447\u0443\u0432\u0441\
    \u0442\u0432\u0430\u043C\u0438, \u043A\u0430\u043A \u0434\u0432\u0430 \u0431\u0435\
    \u0437\u0443\u043C\u043D\u044B\u0445, \u0432\u0435\u043B\u0438\u043A\u043E\u043B\
    \u0435\u043F\u043D\u044B\u0435 \u043C\u0430\u0433\u0433\u043E\u0442\u044B, \u0441\
    \u043C\u0435\u044F\u044E\u0449\u0438\u0435\u0441\u044F \u043D\u0430 \u043E\u0447\
    \u0435\u043D\u044C \u0432\u043D\u0438\u043C\u0430\u0442\u0435\u043B\u044C\u043D\
    \u043E\u043C \u0431\u0430\u0440\u0435 \u043C\u0438\u0446\u0432\u0430, \u043A\u043E\
    \u0442\u043E\u0440\u044B\u0439 \u0438\u043C\u0435\u043B \u043A\u043B\u0430\u0441\
    \u0441\u0438\u0447\u0435\u0441\u043A\u0443\u044E \u043C\u0443\u0437\u044B\u043A\
    \u0443, \u0438\u0433\u0440\u0430\u044F \u0432 \u0444\u043E\u043D\u043E\u0432\u043E\
    \u043C \u0440\u0435\u0436\u0438\u043C\u0435 \u0438 \u0434\u0432\u0430 \u0437\u0430\
    \u0431\u043E\u0442\u043B\u0438\u0432\u044B\u0445 \u0434\u044F\u0434\u044F, \u0434\
    \u0443\u043C\u0430\u044F \u043D\u0430 \u0431\u0438\u0442\u044C."
  p1626256393.394816: "\u041E\u0431\u0444\u0443 \u0438\u0437\u0443\u0447\u0430\u043B\
    \ \u0448\u0438\u0440\u043E\u043A\u0438\u0435 \u0431\u043E\u0440\u043E\u0434\u044B\
    \ \u0410\u043C\u0431\u0438\u0435\u043D \u0438 \u043F\u0440\u044F\u043D\u044B\u0435\
    \ \u0440\u0435\u0441\u043D\u0438\u0446\u044B. \u0412 \u043A\u043E\u043D\u0446\u0435\
    \ \u043A\u043E\u043D\u0446\u043E\u0432, \u043E\u043D \u0432\u0437\u044F\u043B\
    \ \u0433\u043B\u0443\u0431\u043E\u043A\u043E\u0435 \u0434\u044B\u0445\u0430\u043D\
    \u0438\u0435. \"\u042F \u0441\u043E\u0436\u0430\u043B\u0435\u044E, \u043D\u043E\
    \ \u043D\u0435 \u043C\u043E\u0433\u0443 \u0434\u0430\u0442\u044C \u0432\u0430\u043C\
    \ \u0441\u043F\u0440\u0430\u0432\u0435\u0434\u043B\u0438\u0432\u043E\u0441\u0442\
    \u044C\", \u043E\u043D \u043E\u0431\u044A\u044F\u0441\u043D\u0438\u043B, \u0432\
    \ \u0436\u0430\u043B\u0443\u044E\u0449\u0438\u0445 \u0442\u043E\u043D\u0430\u0445\
    ."
  p1626256393.394817: "\u0410\u043C\u0431\u0438\u0435\u043D \u0432\u044B\u0433\u043B\
    \u044F\u0434\u0435\u043B \u043D\u0435\u0440\u0430\u0437\u0440\u044B\u0432\u043D\
    \u043E, \u0435\u0433\u043E \u0442\u0435\u043B\u043E \u0441\u044B\u0440\u043E\u0435\
    \ \u043A\u0430\u043A \u043C\u043E\u0433\u0443\u0449\u0435\u0441\u0442\u0432\u0435\
    \u043D\u043D\u044B\u0439, \u0441\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\
    \u0430\u044F \u043A\u0430\u0440\u0442\u0430."
  p1626256393.3948178: "Obfus \u043C\u043E\u0436\u0435\u0442 \u043D\u0430 \u0441\u0430\
    \u043C\u043E\u043C \u0434\u0435\u043B\u0435 \u0443\u0441\u043B\u044B\u0448\u0430\
    \u0442\u044C \u0442\u0435\u043B\u043E Ambien \u0432 3833 \u0447\u0430\u0441\u0442\
    \u0438. \u0417\u0430\u0442\u0435\u043C \u043B\u044E\u0431\u044F\u0449\u0438\u0439\
    \ \u0441\u043B\u043E\u043D \u043E\u0442\u043E\u0440\u0432\u0430\u043D \u0432 \u0440\
    \u0430\u0441\u0441\u0442\u043E\u044F\u043D\u0438\u0435."
  p1626256393.3948188: "\u0414\u0430\u0436\u0435 \u0441\u0442\u0430\u043A\u0430\u043D\
    \ \u0432\u0438\u043D\u0430 \u043D\u0435 \u0443\u0441\u043F\u043E\u043A\u0430\u0438\
    \u0432\u0430\u0435\u0442 \u043D\u0435\u0440\u0432\u044B \u041E\u0431\u0444\u0443\
    \ \u0441\u0435\u0433\u043E\u0434\u043D\u044F."
  span1626256393.3948226: "\u0413\u0435\u043D\u0435\u0440\u0430\u0442\u043E\u0440\
    \ \u0448\u0435\u0434\u0435\u0432\u0440\u043E\u0432"
  span1626256393.3948238: "\u041D\u0435 \u0441\u043E\u0445\u0440\u0430\u043D\u0435\
    \u043D\u043E"
